import React from 'react';
import s from './Experiences.module.css';

function ExperiencesCart(carts) {
    debugger;
    return (
        <div style={{ display: "inline-blcok" }} className={s.experiences_cart}>
            <div className={s.title_div}>

                <span id={s.company_name}>{carts.companyName}</span>
                <br />
                <img id={s.company_img} src={carts.companyImageSrc} alt='facebook' />

            </div>

            <span id={s.job}>{carts.job}</span>

            <span id={s.date}>{carts.jobExperience}</span>

            <br />
            <span id={s.impressions}>{carts.impressions}</span>
        </div>
    );
}

export default ExperiencesCart;
